INSERT INTO `data` VALUES ('0a0nmv','SweetWater Motor Boat',NULL,'Leaf Season – Silver medal winner “08 & 09 Great American Beer Festival! Our titillating version of an ESB. Dry Hopped for a face full of flavor.','5.6',3,'N','verified','Verified','2012-01-03 02:44:20','2015-12-16 06:54:14'),('4a5joT','Clausthaler Radler Lemon',NULL,NULL,NULL,0,'N','verified','Verified','2012-08-12 12:08:42','2015-04-24 13:24:38'),('65Ict4','Barrel Aged Qualified',NULL,'Once a year Taxman fills fresh bourbon barrels with a rich Belgian Imperial Stout. Several months later Death & Taxes is transferred leaving behind barrels with a beautiful combination of residual bourbon and imperial stout notes. Enter Qualified, our strong, dark Belgian quadruple featuring deep notes of raisin and plum, enhanced by dynamic Belgian esters. After months in these barrels, Qualified is transformed into the big, bolder, richer Death & Taxes cut.','9.5',60,'N','verified','Verified','2017-01-18 15:36:27','2017-02-17 20:59:06'),('cHJsNt','Fisherman\'s 70/- Shilling Scottish Ale',NULL,'Shilling categories were based on price charged per hogshead (54 Imperial gallons) during the 19th century in Scotland. Our 70 Shilling has medium malty sweetness, low hop character and mild caramel notes leading to a clean dry finish.',NULL,8,'N','verified','Verified','2012-04-13 01:57:15','2015-12-16 16:37:22'),('FvZjcw','Hellers Wiess',NULL,NULL,'4.5',45,'N','verified','Verified','2012-08-12 12:16:13','2014-10-10 19:21:03'),('OzXH9G','Liège',NULL,'Belgian tripel fermented with maple syrup and aged on whole vanilla beans.','8.6',59,'N','verified','Verified','2017-01-20 16:08:46','2017-01-20 16:08:46'),('Q9tYhD','Southern Pale Ale',NULL,'Medium-bodied deep golden ale with distinct bitter character and a hoppy, piney, citrus finish.','5.2',25,'N','verified','Verified','2012-01-03 02:44:15','2016-06-01 01:49:10'),('QtBPaD','Rock Slide Amber Ale',NULL,'A spin off from our Oktoberfest; this full flavored Amber Ale is well balanced with a hint of toasted malt; making it a smooth brew to enjoy.',NULL,32,'N','verified','Verified','2014-09-23 19:32:46','2015-12-17 19:04:15'),('ssqFJT','The Jungle Bock',NULL,'Rich melanoidins and a caramel, bready malt backbone combine enticingly with a powerful aroma of banana and cloves. Brewed using a decoction mash consisting of NC-based Riverbend Heritage Malt and Appalachian Wheat to honor both tradition and local terroir.','8',53,'N','verified','Verified','2016-05-20 17:43:33','2016-05-20 17:43:33');
